  `last_login_time` datetime DEFAULT NULL COMMENT '上次登录时间',
  `last_login_ip` varchar(64) DEFAULT '' COMMENT '上次登录ip',
  `creater_id` bigint(20) DEFAULT '0' COMMENT '创建者id',
  `password_continue_fails` int(11) DEFAULT '0' COMMENT '连续登录失败的次数',
  `is_password_locked` bit(1) DEFAULT b'0' COMMENT '密码连续错误被锁定',
  `password_locked_time` datetime DEFAULT NULL COMMENT '密码连续错误被锁定时间',
  `remark` varchar(32) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_supervisor_name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='管理员表';

-- ----------------------------
-- Records of t_supervisor
-- ----------------------------

-- ----------------------------
-- Table structure for t_template_notice
-- ----------------------------
DROP TABLE IF EXISTS `t_template_notice`;
CREATE TABLE `t_template_notice` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `type` tinyint(4) DEFAULT '0' COMMENT '模板类型\r\n。1-短信模板；\r\n2-消息模板\r\n；3-邮件模板\r\n',
  `scene` tinyint(4) DEFAULT '0' COMMENT '应用场景',
  `title` varchar(64) DEFAULT '' COMMENT '标题',
  `content` text COMMENT '内容',
  PRIMARY KEY (`id`),
  KEY `idx_template_notice_scene` (`scene`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='通知模版表（系统消息、短信、邮件）';

-- ----------------------------
-- Records of t_template_notice
-- ----------------------------

-- ----------------------------
-- Table structure for t_user
-- ----------------------------
DROP TABLE IF EXISTS `t_user`;
CREATE TABLE `t_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `name` varchar(30) NOT NULL COMMENT '用户名',
  `mobile` char(11) NOT NULL COMMENT '手机号',
  `password` varchar(50) DEFAULT NULL COMMENT '登录密码',
  `pay_password` varchar(50) DEFAULT NULL COMMENT '交易密码',
  `sex` tinyint(4) NOT NULL DEFAULT '0' COMMENT '性别：0未填写，1男，2女',
  `nick_name` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '昵称',
  `photo` varchar(255) DEFAULT NULL COMMENT '头像',
  `role_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '角色：1顾客，2会员，3美容师，4顾问',
  `employee_id` bigint(20) NOT NULL DEFAULT '-1' COMMENT '员工id：role_type为3,4的时候才会用到该字段，否则为-1',
  `login_time` datetime DEFAULT NULL COMMENT '登录时间',
  `login_count` int(11) DEFAULT NULL COMMENT '登录次数',
  `login_ip` varchar(30) DEFAULT NULL COMMENT '登录ip',
  `wx_open_id` varchar(50) DEFAULT NULL COMMENT '微信openid',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_user_mobile` (`mobile`) USING BTREE,
  KEY `idx_user_wx_open_id` (`wx_open_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of t_user
-- ----------------------------

-- ----------------------------
-- Table structure for t_user_address
-- ----------------------------
DROP TABLE IF EXISTS `t_user_address`;
CREATE TABLE `t_user_address` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '添加时间',
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户id',
  `name` varchar(30) DEFAULT NULL COMMENT '姓名',
  `mobile` char(11) DEFAULT NULL COMMENT '手机号',
  `province_id` bigint(20) DEFAULT NULL COMMENT '省份id：冗余字段',
  `city_id` bigint(20) DEFAULT NULL COMMENT '城市id：冗余字段',
  `area_id` bigint(20) DEFAULT NULL COMMENT '地区id',
  `detail` varchar(200) DEFAULT NULL COMMENT '详细地址',
  `is_default` bit(1) DEFAULT b'0' COMMENT '是否是默认地址：0不是默认地址，1是默认地址',
  `is_del` bit(1) DEFAULT b'0' COMMENT '是否已经删除：0没有删除，1已经删除',
  PRIMARY KEY (`id`),
  KEY `idx_user_address_user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户收货地址';

-- ----------------------------
-- Records of t_user_address
-- ----------------------------

-- ----------------------------
-- Table structure for t_user_bonus
-- ----------------------------
DROP TABLE IF EXISTS `t_user_bonus`;
CREATE TABLE `t_user_bonus` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '用户id',
  `service_order_no` varchar(40) NOT NULL COMMENT '业务订单号',
  `amount` decimal(20,2) NOT NULL COMMENT '佣金',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '佣金类型：1直推奖，2合作奖，3一级奖，4二级奖，5人头奖，6双人奖',
  `relation_id` bigint(20) NOT NULL DEFAULT '-1' COMMENT '关联id：type值1-4和6时采用t_user_bonus_detail的id，值为5时默认等于-1',
  `invite_number` int(15) NOT NULL DEFAULT '0' COMMENT '顾问或者美容师人头奖对应的人头数量',
  `fee` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '管理费',
  `is_return` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否返还：0表示未返还，1表示已经返还',
  `return_time` datetime DEFAULT NULL COMMENT '返还时间',
  `remark` varchar(50) NOT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `idx_user_bonus_user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='用户奖金';

-- ----------------------------
-- Records of t_user_bonus
-- ----------------------------

-- ----------------------------
-- Table structure for t_user_bonus_detail
-- ----------------------------
DROP TABLE IF EXISTS `t_user_bonus_detail`;
CREATE TABLE `t_user_bonus_detail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间：计算人头奖励，以该时间为准',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '得到佣金的用户id',
  `relation_user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '产生佣金的关联用户id',
  `relation_user_spread_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '产生佣金的关联用户的邀请人id',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '类型：1直推奖，2合作奖，3一级奖，4二级奖，5人头奖，6双人奖',
  PRIMARY KEY (`id`),
  KEY `idx_user_bonus_detail_user_id` (`user_id`) USING BTREE,
  KEY `idx_user_bonus_detail_relation_user_id` (`relation_user_id`) USING BTREE,
  KEY `idx_user_bonus_detail_relation_user_spread_id` (`relation_user_spread_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8 COMMENT='用户奖金详细表';

-- ----------------------------
-- Records of t_user_bonus_detail
-- ----------------------------

-- ----------------------------
-- Table structure for t_user_funds
-- ----------------------------
DROP TABLE IF EXISTS `t_user_funds`;
CREATE TABLE `t_user_funds` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `balance` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '账户余额',
  `available_balance` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '可用的账户余额（用作可提现）',
  `freeze` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '冻结金额',
  `sign` varchar(50) NOT NULL COMMENT '用户资金加密：MD5(user_id+balance+freeze)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_user_funds_user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='用户资金信息';

-- ----------------------------
-- Records of t_user_funds
-- ----------------------------

-- ----------------------------
-- Table structure for t_user_info
-- ----------------------------
DROP TABLE IF EXISTS `t_user_info`;
CREATE TABLE `t_user_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `mobile` char(11) NOT NULL COMMENT '手机号：冗余字段',
  `store_id` bigint(20) NOT NULL DEFAULT '-1' COMMENT '店面id',
  `spread_id` bigint(20) NOT NULL DEFAULT '-1' COMMENT '邀请人id：美容师和顾问之间不存在邀请关系',
  `spread_time` datetime DEFAULT NULL COMMENT '邀请时间',
  `beautician_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '所属美容师id：会员所属美容师id，其他的默认为0',
  `adviser_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '所属顾问id：会员、美容师对应顾问id，其他默认为0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_user_info_user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='用户信息表';

-- ----------------------------
-- Records of t_user_info
-- ----------------------------

-- ----------------------------
-- Table structure for t_withdrawal_user
-- ----------------------------
DROP TABLE IF EXISTS `t_withdrawal_user`;
CREATE TABLE `t_withdrawal_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `amount` decimal(20,2) NOT NULL COMMENT '提现金额',
  `fee` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '手续费',
  `available_balance` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '账户可提现金额',
  `service_order_no` varchar(40) NOT NULL COMMENT '业务订单号',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '提现方式：1零钱，2银行卡',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '提现状态：1待审核，2处理中，3成功，-1拒绝',
  `audit_time` datetime DEFAULT NULL COMMENT '审核时间',
  `audit_supervisor_id` bigint(20) DEFAULT NULL COMMENT '审核人员',
  `audit_opinion` varchar(30) DEFAULT NULL COMMENT '审核意见',
  `complete_time` datetime DEFAULT NULL COMMENT '提现完成时间',
  `complete_info` varchar(100) DEFAULT NULL COMMENT '提现完成信息',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `idx_withdrawal_user_user_id` (`user_id`) USING BTREE,
  KEY `idx_withdrawal_user_service_order_no` (`service_order_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='用户提现表';

-- ----------------------------
-- Records of t_withdrawal_user
-- ----------------------------

-- ----------------------------
-- Table structure for t_wx_chat
-- ----------------------------
DROP TABLE IF EXISTS `t_wx_chat`;
CREATE TABLE `t_wx_chat` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `open_id` varchar(50) NOT NULL COMMENT 'openid',
  `nick_name` varchar(255) CHARACTER SET utf8mb4 NOT NULL COMMENT '昵称',
  `image_url` varchar(255) NOT NULL COMMENT '头像',
  `sex` tinyint(4) NOT NULL DEFAULT '0' COMMENT '性别（0未知，1男，2女）',
  `wx_info` text CHARACTER SET utf8mb4 COMMENT '微信授权信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='微信绑定';

